import React, { Component } from 'react'
import { withRouter } from 'react-router';
import AppBody from '../../../../components/AppBody';

class ShowBlogPage extends Component {

    constructor(props){
        super(props);
        this.state={
            loading:false,
        }
    }

    render() {
        return (
            <>
                <AppBody
                    loader={true}
                />
            </>
        )
    }
}
export default withRouter(ShowBlogPage);
